import {DivisionObject} from "../../common/Division.ts";
import {TeamObject} from "../../common/Team.ts";
import {FieldSetObject} from "../../common/FieldSet.ts";
import {PeriodObject} from "../../common/Period.ts";
import {getReq} from "./net.ts";

// @ts-ignore
export const env = await getReq('/env/TM');

export const ASPECT_RATIO = 1/0.618;
export const SMALL_PART = 38.2;
export const LARGE_PART = 61.8;

export const PAD = 1.618;
export const PAD2 = PAD * 2;
export const PAD3 = PAD * 3;
export const PAD4 = PAD * 4;
export const PAD5 = PAD * 5;

export const PAD1_5 = PAD * 1.5;


export const DEFAULT_DIVISION: DivisionObject = {
    divisionName: "",
    divisionFields: []
}

export const DEFAULT_TEAM: TeamObject = {
    teamNumber: "",
    teamName: "",
    teamOrganization: "",
    teamDivision: ""
}

export const DEFAULT_FIELD_SET: FieldSetObject = {
    fieldSetId: 0,
    fields: []
}

export const DEFAULT_PERIOD: PeriodObject = {
    periodNumber: 0,
    periodType: "",
    periodStartTime: "",
    periodEndTime: "",
    periodMatchDuration: 0
}


export interface PictureObject {
    url: string;
    name: string;
}

export const PICTURES: PictureObject[] = [
    {
        url: "data:image/png;base64,",
        name: "VEX GO"
    },
    {
        url: "data:image/png;base64,",
        name: "CreatechStudio"
    },
];

const logos: string[] = env.TM_VENDOR_LOGO.split(',');
logos.forEach((logo: string) => {
    if (logo.length > 0) {
        PICTURES.push({
            url: logo.trim(),
            name: "Vendor Logo"
        });
    }
});

export const RANK_TABLE_SCROLL_SPEED = parseFloat(env.TM_RANK_TABLE_SCROLL_SPEED) || 0.03;
export const TOURNAMENT_NAME = env.TM_TOURNAMENT_NAME || "VGORC";
export const LOGO_INTERVAL_NUMBER = parseInt(env.TM_LOGO_INTERVAL_NUMBER) || 20;

export const RETURN_URL_PARAM_KEY = "returnUrl";

export function generateSocketUrl(endpoint: string) {
    return `/socket/${endpoint}`;
}
